('cpf01', '1. List a minimum of three etiologies that underlie a sensory-based oral feeding aversion.<br>\r\n2. Identify two characteristics of feeding difficulty that occur during the esophageal phase of swallow.<br>\r\n3. Describe three variables that can be modified as part of a feeding program to help a child make the transition from liquids to pureed foods.', 'This course focuses on the evaluation and treatment of children \r\nwho have not yet been able to transition from liquids to pureed foods. A therapeutic program is outlined and a checklist is provided for data collection. Five pages of downloadable handouts are included.', 'Advanced. $40.00.'),
('cpf02', '1. List two oral-motor issues and two oral-sensory issues that interfere with the successful transition from pureed food to solids.<br>\r\n2. Explain the Feeding Transition Readiness assessment tool.<br>\r\n3. Define three different categories of foods that may be used in a feeding program.', 'This course discusses the child who has not yet made the transition from pureed food to solids and outlines both sensory and motor issues. Treatment strategies are outlined and a Feeding \r\nTransition Readiness tool is explained and included in the five pages of handouts.', 'Advanced. $40.00.'),
('od1', '1) Explain anatomy and physiology of the infant oral mechanism;<br>\r\n2) Identify the components and types of neonatal sucking;<br>\r\n3) Differentiate normal from disorganized and dysfunctional sucking;<br>\r\n4) Outline similarities and differences with breast and bottle feeding;<br>\r\n5) List three types of sensory feeding problems in the neonate;<br>\r\n6) Identify &quot;diagnostic-based&quot; treatment strategies for infants with a \r\ndisorganized and dysfunctional suck.', '', '$5.00'),
('s01', '1. Identify infants at high risk for feeding difficulties.<br>2. Identify strategies for supporting successful feedings.<br>3. Identify infants appropriate for referral to a feeding specialist.', 'Identify infants at risk for feeding difficulties and explain strategies for supporting successful feeding.', '$35 Intermediate instructional level.'),
('s02', '1. Understand rationale for measurement, and tools and validation for measuring non-nutritive suck in the NICU.<br>2. Understand qualitative and quantitative aspects of NNS ontogeny in premature newborns.<br>3. How NNS evaluation relates to feeding performance in light of immediate/contextual factors that influence NNS behavior.', 'Describe the qualitative and quantitative aspects of NNS ontogeny in premature infants and how these relate to feeding performance.', '$35 Advanced instructional level.'),
('s03', '1.  Describe the normal maturation of gastrointestinal motility in the premature.<br>2.  Describe the normal maturation of digestion and absorption in the premature.<br>3.  Describe disorders that impact upon the normal developmental process and interfere with feeding.', 'Describe the normal maturation of gastrointestinal motility in the premature infant and identify disorders that impact the normal developmental process.', '$35 Advanced instructional level.'),
('s04', '1. Describe self regulation and identify regulatory behaviors of full term newborns or less mature or premature newborns.<br>2. Describe factors which impact infant self regulation.<br>3. Identify and describe developmental recommendations to facilitate self regulation.', 'Explain self-regulation in the newborn and describe factors that impact the development of regulatory behaviors.', '$35 Intermediate instructional level.'),
('s05', '1. Identify the components of state, breathing, and oral control needed for feeding.<br>2. Correctly identify immature breathing and apnea that will interfere with feeding.<br>3. Identify risk factors for aspiration and how to diagnose aspiration.', 'Describe the components of state, breathing, and feeding in the premature infant and identify risk factors for aspiration.', '$35. Intermediate instructional level.'),
('s06', '1. Describe the significance of focused feeding assessment.<br>2. Identify short-term effectiveness of using a co-regulated feeding approach with enhanced auditory assessment.<br>3. Describe the skill of infant oral feeding using a dynamic systems theory framework.', 'Describe the skill of infant oral feeding using a focused feeding assessment.', '$35. Intermediate instructional level.'),
('s07', '1. Describe the literature that establishes importance of experience on the fetal brain.<br>2. Describe the benefits of kangaroo care for both infants and mothers.<br>3. Discuss the issues associated with early and often kangaroo care in high-tech nurseries.', 'Focuses on the infant brain-3rd trimester; importance of touch to newborn mammals; skin-to-skin vs. incubators; benefits of skin-to-skin; challenges and opportunities with implementation.', '$35. Intermediate instructional level.'),
('s08', '1. Appreciate the impact of developmental care-giving on the synactive development of first order neurons and cranial nerves in response to head shape.<br>2. Discuss the neurodevelopmental differences between oral-tracheo and naso-tracheal intubation.<br>3. Plan appropriate care-giving strategies to impact synactive development of the head and neck areas.', 'Describe the differences between oro-tracheo and naso-tracheal intubation and their impact on early feeding in the context of the synactive development of the head and neck.', '$35. Advanced instructional level.'),
('s09', '1. Review basic neuroanatomy and developmental neurobiology of olfaction.<br>2. Discuss the ways in which odors affect newborn behavior.<br>3. Discuss how knowledge of these effects might contribute to supporting early growth and development of sick newborns.', 'Both premature and term newborns have a keen sense of smell. From the first days of life newborns are attracted to he scent of amniotic fluid and form an early attraction to the scent of breast milk. We will discuss the ways in which odors affect newborn behavior and how knowledge of these effects might contribute to supporting early growth and development of sick newborns.', '$35. Advanced instructional level.'),
('s10', '1. Describe a typical feeding and the reasons it is efficient.<br>2. Describe how feeding matures for increased intake in the infant.<br>3. Identify problems that can occur with the flow rate of the feeding.', 'Provides a comprehensive overview of typical infant feeding and the interaction of normal anatomy, neurologic function, and respiration; normal physiology of suck/swallow/breathe in the term infant and the typical progression of feeding maturity in breast and bottle feeding will be reviewed; phases of swallow will be discussed; and essential studies will be used to demonstrate the\r\nprinciples of efficiency in feeding.', '$35. Intermediate instructional level.'),
('s11', '1. Identify feeding problems that can be unsafe for the infants health.<br>2. Identify support to assist oral feeding in the infant with atypical development.<br>3. Explain using tube feedings in the least intrusive and most developmentally helpful manner to support growth in the infant with atypical development.', 'Provides an overview of common feeding problems seen in the infant with atypical neurological findings; support for breast and bottle feeding will be discussed using case examples; and the concepts of safety, efficiency, and sufficiency as well as supplementation will be addressed.', '$35. Intermediate instructional level.'),
('s12', '1.  Define characteristics and recognize visceral hyperalgesia in the older infant.<br>2.  Explain correlation between gastroesophageal reflux and visceral hyperalgesia.<br>3.  Understand why the feeding problems of these patients are often mis-diagnosed as behavioral.', 'Describe the characteristics of visceral hyperalgesia and explain why infants with this condition are often mis-diagnosed as having behaviorally based feeding problems.', '$35. Advanced instructional level.'),
('v01', '1. List the Six Primitive Oral Reflexes.<br>2. Explain Changes in Oral Anatomy: Birth to Six Months.<br>3. Describe Volitional Bolus Transfer During the Management of Solid Food.', 'This discussion will address changes in the infants oral anatomy and physiology from birth to six months and beyond.  Pay close attention to the primitive oral reflexes, the emergence of volitional oral-motor skills, and the relationship between the anatomical changes and oral skill development.', 'Introductory. $40.00.'),
('v02', '1. List the Two Types of Normal Suck Patterns.<br>                            2. List Three Characteristics of Jaw & Tongue Movement in the Disorganized Suck.<br>3. Describe at least Four Characteristics of Dysfunctional Suck.', 'This course contains very specific information on neonatal sucking that includes the development of suck/swallow/breathe coordination, characteristics of jaw and tongue movement, types of sucking patterns, and clinical signs of a dysfunctional suck.  Pay close attention to the definitions, description, and terminology.', 'Advanced. $95.00.'),
('v03', '1. Suggest Ways to Improve Neonatal Feeding in the NICU.<br>                            2. Difference between External Pacing and Regulation For the Disorganized Feeder.<br>3. Use of Therapeutic Techniques for the Dysfunctional Feeder.', 'This course discusses treatment strategies and intervention techniques that include pacing, regulation, jaw and cheek support, and positioning.  It is important to learn when to use each of these techniques appropriately and when a technique is contra-indicated.', 'Advanced. $190.00 (includes courses #2 and #3)'),
('v04', '1. Recognize the differences between motor and sensory disorders of neonatal sucking.<br>2. Identify four characteristics of a motor based feeding disorder.<br>3. Describe three types of sensory feeding problems.', 'The viewer will be introduced to motor problems of the jaw and tongue during sucking as well as the sensory issues of perseveration, habituation, poor adaptability, and visceral hyperalgesia.  It is important to understand how a sensory-based feeding aversion develops and characteristics of infants that are predisposed.', 'Intermediate. $55.00.'),
('v05', '1. Describe the feeding difficulty for a premature infant with a disorganized suck.<br>2. Recognize the clinical signs of dysphagia.<br>3. Know when to appropriately refer for an MBS study.', 'Viewer will be expected to differentiate early feeding disorders based upon prematurity or dysphagia.  An understanding of the immature suck pattern as well as the causes of dysphagia  are needed in order to determine when to refer an infant for a modified barium swallow study.', 'Advanced. $75.00.'),
('v06', '1. Properly Select Position, Utensil, And Consistencies For The MBS.<br>2. Describe The Oral, Pharyngeal, And Esophageal Phases Of Swallow.<br>3. Accurately Diagnose The Problem.', 'Attention will be paid to all three phases of swallow:  oral, pharyngeal, and esophageal.  Clinical signs of esophageal dysmotility will be discussed and viewed on videofluoroscopic studies.  If you are unfamiliar with the esophageal phase of swallow, pay close attention.', 'Advanced. $95.00.'),
('v07', '1. Describe jaw and tongue movements of the child with hypertonicity.<br>2. Explain persistent oral-motor patterns in a child with hypotonicity.<br>3. Identify clinical signs of sensory-based oral feeding disorder.', 'The effects of hypertonicity and hypotonicity on the oral musculature will be discussed as well as the clinical signs of sensory feeding problems. It is important to recognize the difference among oral-motor patterns and to properly interpret the clinical signs.', 'Introductory. $40.00.'),
('v08', '1. Explain the use of \"incremental progression\" as a treatment strategy.<br>  2. Outline the \"wheat germ\" program.<br>                            3. Identify clinical signs of sensory-based oral feeding disorder.', 'Learn to understand the clinical signs of sensory-based feeding disorders and the impact on oral-motor skill development and food selection. Remember  that treatment strategies are prescriptive in nature and designed to progress gradually toward the goal.', 'Intermediate. $65.00.'),
('v09', '1. Describe the correlation between gastroesophageal reflux and esophageal dysmotility.<br>2. Conduct a competent clinical (bedside) feeding evaluation.<br>                            3. Accurately diagnose esophageal phase dysphagia when it is the underlying etiology of an oral feeding disorder.', 'Close examination of the conditions underlying and/or contributing to gastroesophageal reflux and esophageal dysmotility help us to better understand the feeding disorder. Pay attention to the clinical signs.', 'Advanced. $95.00.'),
('v10', '1. Describe the three types of gastroesophageal reflux.<br>2. Explain esophageal dysmotility and its impact on the transition onto solids.<br>3. Plan effective intervention strategies for progression onto solids.', 'Children with gastroesophageal reflux and/or esophageal dysmotility often have a delayed transition onto solids.  Pay attention to the clinical signs and the food choices.  Intervention is a gradual process to improve esophageal motility.', 'Advanced. $185.00 (includes #9 and #10).'),
('v11', '1. Describe the process of transitioning from continuous drip feeding onto bolus.<br>2. Determine when it is appropriate to implement a 60-hour wean.<br>3. Be able to select the appropriate candidate for weaning.', 'Weaning from tube to oral feeding is a process that requires oral-motor competence, tolerance for bolus feeds, and the ability to recognize hunger.  Pay attention to the Phases of the Protocol and the 60-hour wean.', 'Advanced. $95.00.');
